const options = [
  { value: "1", label: "1 CIE F1" },
  { value: "2", label: "2 CIE F2" },
  { value: "3", label: "3 CIE F3" },
  { value: "4", label: "4 CIE F4" },
  { value: "5", label: "5 CIE F5" },
  { value: "6", label: "6 CIE F6" },
  { value: "7", label: "7 CIE F7" },
  { value: "8", label: "8 CIE F8" }
];

class Examples extends React.Component {
  state = {
    selectedOption: null,
    loading: false,
    data: [],
    tableReady: false
  };
  handleChange = selectedOption => {
    this.setState({ selectedOption });
    console.log(`Option selected:`, selectedOption);
  };
  render() {
    const { selectedOption } = this.state;

    return (
      <form onSubmit={this.handleSubmit}>
        <Select
          value={selectedOption}
          onChange={this.handleChange}
          options={options}
        />
        <br />
        <div>
          {loading ? (
            <div>
              <label>
                {" "}
                Calculating Results <br />{" "}
                <LoadingSpinner color="copper" size="6" />{" "}
              </label>
            </div>
          ) : (
            <Button bsSize="sm" type="submit">
              Calculate
            </Button>
          )}
        </div>
      </form>
    );
  }
}

export default Examples;
